(15617, 60231, 1692, 1, '正義', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '　　惦抵這咧人吃人ㄟ社會 自私自利資本主義\n　　百姓ㄟ性命巄無值錢 官商勾結黑金利益\n　　\n　　看到這咧自私ㄟ世界 啥咪代誌巄用金錢咧看待\n　　禮義廉恥寫抵學校ㄟ璧頂 大漢了後金錢才是第一\n　　\n　　我想要反抗 我想要革命 用我ㄟ歌聲唱倒世界ㄟ不公平\n　　我想要真理 我想要和平 用正義ㄟ反抗換來自由ㄟ願望\n　　\n　　拿出咱ㄟ正義 勇敢站起來抗爭\n　　為了世界和平 犧牲生命來完成\n　　\n　　拿出咱ㄟ良心 看待苦難ㄟ人民\n　　為了生活ㄟ安定 舉起咱ㄟ雙手來革命', 200, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:52:50', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15618, 60231, 1692, 10, '花蓮', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '你甘災阿有一咧囝仔住抵東部ㄟ海邊\n　　伊每天自己一咧歡歡喜喜咧玩海水\n　　看伊快樂靠在山頂 將伊雙腳伸入海面\n　　日頭當中伊咪咪阿笑說伊ㄟ名字叫花蓮\n　　\n　　有一天一個人偷偷接近伊ㄟ身邊\n　　強姦伊ㄟ身軀也搶走身邊所有ㄟ錢\n　　糟蹋以後離開花蓮倒轉去繁華大都市\n　　新聞媒體又說伊是咱社會進步ㄟ正義\n　　\n　　花蓮阿花蓮 美麗ㄟ海岸\n　　好山好水 也有清香ㄟ空氣\n　　\n　　花蓮阿花蓮 清澈ㄟ海水\n　　依靠中央山脈 也有太平洋咧陪\n　　\n　　你甘災阿這是台灣最後一片美麗土地\n　　請你放伊一條生路破壞了了你甘賠的起\n　　\n　　你甘災阿這是子孫最後一片生存土地\n　　請你放伊一條生路讓伊單純來過日子', 357, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:53:01', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15619, 60231, 1692, 11, '沒正義就沒和平', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '沒正義就沒和平\n創作/農村武裝青年\n.\n我們的國家都讓財團在控制\n我們的社會都讓有錢人在控制\n我們的媒體都讓政黨在控制\n什麼時候才有真正的公平？\n.\n沒正義就沒和平　沒和平\n沒正義就沒和平　沒和平\n.\n沒正義就沒和平\n沒正義就沒和平\n沒正義就沒和平\n.\n沒正義就沒和平　沒和平\n沒正義就沒和平　沒和平\n.\n你在強姦我們的社會\n你在強姦這片土地\n你在強姦這兒的人民\n你在強姦這兒的一切\n.\n你在強姦我們的社會\n你在強姦這片土地\n你在強姦這兒的人民\n你在強姦這兒的一切\n.\n沒正義就沒和平\n沒正義就沒和平\n沒正義就沒和平', 247, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:53:11', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15620, 60231, 1692, 2, '阮不願再種田', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '　阮嘸袂種田 多種丟多怨嘆\n　　阮嘸袂種田 越種丟越歹賺\n　　阮嘸袂種田 那個啥咪WTO真怨嘆\n　　\n　　楊儒門17顆炸彈 表達台灣農民ㄟ心聲\n　　伊講無躺溝再進口白米 政府丟愛照顧咱農民\n　　關了兩年也沒改變 因為恁根本無咧聽\n　　\n　　政府恁甘有咧聽 聽阮做田人ㄟ心聲\n　　政府恁甘有咧聽 每天為了選舉咧車拼\n　　政府恁甘有咧聽 耳朵摀著朧尬恁爸當無聽\n　　\n　　美國老大咧嗆聲 您親像龜仔囝躲咧不敢出聲\n　　趕快跪著捧懶趴 因為恁ㄟ利益朧低那\n　　講啥咪WTO最公平 恁爸聽你咧幹你娘\n　　\n　　WTO 最公平 WTO 給恁賺大錢\n　　政府阿！政府阿！政府阿！全部朧齁你賺了了', 120, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:53:19', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15621, 60231, 1692, 3, '重返鄉土', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '倒轉來故鄉 看看這片土地\n　　到底是發生啥咪款ㄟ問題\n　　\n　　到轉來故鄉 尬阮阿母來作伙\n　　陪伴這片飼阮大漢ㄟ土地\n　　\n　　到轉來農村 看看這ㄟ百姓\n　　為了甚麼代誌咧靠杯\n　　\n　　到轉來農村 尬阮ㄟ鄉親來作伙\n　　共同打拼為了子孫好將來\n　　\n　　支持咱ㄟ農村 支持咱ㄟ農民 支持在地的農產品\n　　維護咱ㄟ農村 維護咱ㄟ農民 維護土地的美麗\n　　\n　　重返鄉土 前進農業 打造台灣ㄟ新生命\n　　重返鄉土 前進農業 找尋台灣ㄟ新希望\n　　重返鄉土 前進農業 為了咱ㄟ子孫繼續拼\n　　重返鄉土 前進農業 咱是台灣勇敢ㄟ番薯仔囝', 182, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:53:28', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15622, 60231, 1692, 4, '好好來吃飯', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '好好來吃飯 (農村曲開場)                                                    作詞作曲：阿達\n\n介紹您一咧好所在，每個月第二個禮拜六，農民歡喜咧賣菜，服務品質卡實在\n\n高麗菜新鮮有甜味，柳丁健康又包甜，手工的菜圃有滋味，大人囝仔玩趣味\n\n這是美麗ㄟ寶島，也有有機ㄟ水果，農民辛苦的結果，歡迎大家來七逃\n\n這是健康又環保，來買有機的東西真正好，乎咱ㄟ子孫阿有希望，乎咱的土地真美好\n\n來吃台灣米，充滿在地的人情味，來買台灣的農產品，健康環保好口味\n\n好好務農，好好阿來吃飯，好好生活，好好阿來讀書\n\n好好務農，好好阿來吃飯，好好生活，好好阿來讀書\n\n(農村曲結尾)', 217, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:53:37', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15623, 60231, 1692, 5, '子孫的願望', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '子孫ㄟ願望\n\n天清清！  地靈靈！ 有請眾神明\n求您原諒  無知犯錯ㄟ人\n\n天清清！  地靈靈！ 有請媽祖婆來顯靈\n保庇天  保庇地  保庇子子孫孫心光明\n\n眾生  眾生  不通擱犯錯害子孫來傷心\n日頭  海湧  聽說已經袜來報冤仇\n\n拜請土地公伯阿  風調雨順   普度天地\n拜請觀世音菩薩  救苦救難   普渡眾生\n\n子孫ㄟ願望  望咱相照顧\n子孫ㄟ未來  大家愛想看麥\n\n拜請觀世音菩薩  保庇子子孫孫不通擱犯錯\n拜請土地公伯阿  希望日頭海湧一切光明\n\n天清清 地靈靈  有請眾神明\n保庇天地有情  國泰民安  幸福來過日子 \n', 204, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:53:46', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15624, 60231, 1692, 6, '三鶯部落之歌', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '（原住民語）\n　　\n　　我離開故鄉 來到三鶯部落 是為了求生存\n　　想不到政府 來糟蹋我們家 還要把我們趕走\n　　\n　　三鶯部落 抗爭到底', 142, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:53:55', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15625, 60231, 1692, 7, '部落哀歌', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', 'C         G       Am          Em\n想起當初少年時 為了生活來到台北市\nF            C          Dm7         G\n為了生存來工地做事 拼死拼活拼整眠\n \n阮用ㄟ生命來尬恁博 阮用ㄟ力氣來討生活\n認真建設來讓恁住 自己卻沒厝來生活\n \n都市ㄟ厝阮住不起為了生存來到山河邊\n用阮ㄟ雙手來建設創造溫暖ㄟ家園\n \n你不擇手段告阮違建 為了都市的大建設\n也為了恁ㄟ政治路線 拿阮ㄟ生存來交換\n \n你憑甚麼要來拆阮ㄟ厝 用強權糟蹋阮ㄟ靈魂\n憑甚麼建恁ㄟ厝來讓阮住 這不是阮ㄟ文化\nC         G       Am          Em\n你那忍心來拆阮ㄟ厝 用公權欺負阮ㄟ生存\nF            C          Dm7     G      C\n逼阮離開多年的家園 到底阮ㄟ人權底兜位', 232, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:54:05', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
(15626, 60231, 1692, 8, '守護樂生院', '', '2009-02-10 00:00:00', 0000, 20, 0, 1, '', '　為什麼要逼阮來離開\n　　為什麼不尊重阮ㄟ決定\n　　為什麼阮嘸尊嚴\n　　后恁糟蹋看昩起\n　　\n　　甘講阮ㄟ性命嘸值錢\n　　甘講阮ㄟ生存嘸權利\n　　為了完成你ㄟ政治美夢\n　　用強權破壞阮ㄟ希望\n　　\n　　阮ㄟ尊嚴 阮ㄟ意願 期望你來聽 聽阮小小ㄟ心聲\n　　阮ㄟ病痛 阮ㄟ性命 雖然嘸值錢 請你給阮最後一口氣\n　　\n　　守護樂生院 勇敢走下去 手牽手 心連心 我ㄟ在這陪伴恁\n　　守護樂生院 勇敢站鬥陣 用咱ㄟ雙手 爭取最後一口氣', 244, '', '', '', '', '', '', 1, 0, 0, '2009-02-25 20:54:14', '2015-03-12 13:38:30', '0000-00-00 00:00:00'),
